import React, { useEffect, useState } from 'react'
import { http } from '../../axios'
import './index.css'

function ViewItem() {
    const [viewdata, setviewData] = useState([])
    useEffect(() => {
        http.get("purches/tempItems")
            .then(res => {
                console.log(res.data)
                setviewData(res.data)
            })
            .catch(err => {
                console.log(err)
            })
    }, [])
    return (
        <div>
            <table className="table">
                <thead>
                    <tr>
                        <th>Product</th>
                        <th>HSNNO</th>
                        <th>MRP</th>
                        <th>Quantity</th>
                        <th>Rate</th>
                        <th>total</th>
                        <th>GST</th>
                        <th>total</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        viewdata.map(data => {
                            console.log("data", data)
                            return (
                                <tr className="" key={data._id}>
                                    <td>{data.product}</td>
                                    <td>{data.hsnno}</td>
                                    <td>{data.mrp}</td>
                                    <td>{data.qt}</td>
                                    <td>{data.rate}</td>
                                    <td>{data.total}</td>
                                    <td>{data.gst}%</td>
                                    <td>{data.gstTotal}</td>
                                </tr>
                            )
                        })
                    }
                </tbody>
            </table>
        </div>
    )
}

export default ViewItem
